import React from 'react'
import {NavLink} from 'react-router-dom'
import './ButtonLogout.css'


const ButtonLogout = () => {
  return (
    <div>
      <NavLink to='\login' className='btn_logout'>
        Đăng xuất
      </NavLink>
    </div>
  )
}

export default ButtonLogout
